(24, 1475, 1, 'اجرت شخص شقق على يرممها فقط لسلاك كعربا وسباكه واعطي 8اشهر لترميم واحر ابشقق قبل الانتهاء من الترميم وعمل تعديلات دون علمي وفيها مخالفه لنظام البلدية وكذلك خالف الشروط العقد المتفق  عليها العقد ومنها تاحير عماله', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 3, 8, 1546, 0, 1, 0, 0, NULL, '2023-07-27 04:51:46', '2023-07-29 15:34:34', NULL),
(25, 1476, 1, 'السؤال:بحال وجود تزوير في تاريخ السند لامر بحيث قام مدير شركة معزول بتوقيعه بتاريخ ستبق لعزله من الشركة بحيث اصبح يصعب اثبات التزوير وقدم للتنفيذ وصدر القرار التنفيذي', 2, NULL, 0, NULL, 'دوما عبء الاثبات يقع على الطرف المتضرر أو المدعي ومثل هذه الحالة يتم الاثبات بالشهود وخصوصا المحاسب اكيد لديه توثيق', NULL, 2, 32, 1, NULL, NULL, 1, 3, 2, 32, 0, 1, 0, 0, NULL, '2023-07-27 05:29:46', '2023-08-07 17:38:15', NULL),
(26, 1477, 1, 'عليكم\r\n‏في حال تم الحكم النهائي في بيع عقار مشاع في المزاد العلني الحكم للمدعي الثلثين والمدعى عليه الثلث هل يحق للمدعي او المدعى عليه ان يدخل في المزاد لشراء العقار؟\r\n‏وهل اذا دخلا في المزاد لهما اولوية في الشراء؟', 1, NULL, 0, NULL, 'نعم يحق لهم دخول المزاد .\r\nوالأولوية تكون لمن يدفع أكثر فقط .', NULL, 2, 1238, 1, NULL, NULL, 1, 3, 2, 1238, 0, 1, 0, 0, NULL, '2023-07-27 05:33:31', '2023-08-17 15:47:10', NULL),
(27, 1478, 2, 'Dolorem voluptas non', 2, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 1, NULL, NULL, 0, 1, 0, 0, NULL, '2023-07-27 07:04:06', '2023-07-27 07:04:06', NULL),
(28, 1479, 1, 'السلام عليكم ورحمة الله وبركاته\r\n\r\nقدر الله وصار علي حادث بسيط \r\nعلى طريق سريع \"هاي واي\"  وانا متوجه للعمل\r\nوالطريق فيه تقاطع \" يو تيرن\" وامشي السرعة القانونية ٨٠ كيلو متر/ في الساعة\r\nوعند اقترابي من التقاطع كان صاحب سيارة متوسطة الطول لها صندوق مفتوح وتوقف عند التقاطع وعندما شافني اقتربت منه طلع علي فجأة وفاجأني ولا قدرت أسيطر على السرعة ولا قدرت أتجاوزه عن اليسار  وكان على اليسار فاصل اسمنتي للطريق وصاحب السيارة اخذ الشارع كله وابغى اتفاداه حتى لا اصطدم  به وتكون حالة وفاة لواحد مننا وخساير للطرفين وفرملت وتجاوزته على اليمين ودخلت في شجرة وكانت أمام مستودع وتكسرت الشجرة  ودخلت بسيارتي ساحة مستودع لشركة أو مؤسسه لا أعلم بالضبط وسيارته لم تتضرر وهو لم يتضرر  وتضررت سيارتي  وكان صاحب السيارة متعمد فعل ذلك خروجه من التقاطع علي فجأه ولم ينتظرني أن أذهب عنه مسافه بعيده\r\nوسيارته ليس بها تأمين\r\nوسيارتي ليس بها تأمين\r\nوطلبت المرور وحضر وخطط الحادث ووضع العسكري نسبة الخطأ ١٠٠٪ علي\r\nوقال:  العسكري لصاحب السيارة ليس عليك شيء\r\nوقال أيضا:  هو بخروجه علي من التقاطع مخالفة \r\nوقال لي:  تقدر تعترض على نسبة المحقق والمدة ٣٠ يوم \r\nابتداءا من تاريخ الحادث \r\n20/07/2023 يوم الخميس الماضي \r\nواستفساري هو :\r\n\r\n1️⃣ \r\nهل يعد هذا الفعل من صاحب السيارة جريمة قانونية وهل يدخل فيها القتل شبه العمد ؟\r\n\r\n2️⃣\r\nاستمارتي ورخصة القيادة منتهية ، والسيارة ليست سيارتي بل سيارة أخي ولم يقوم اخي بتفويضي بقيادة المركبة وكان هذا نسيان مني ومن أخي ، هل أخالف على ذلك أو ماذا يترتب على ذلك، وهل يلحقني شيء من ذلك؟\r\n\r\n3️⃣\r\nهل اعترض على نسبة المحقق عند المرور وادخل لجنة \r\nوماذا علي ان أفعل اذا اعترضت ودخلت لجنة وما هي الخطوات القانونية الصحيحة للسير في إجراءات الاعتراض لدى المرور ؟\r\n\r\n\r\n4️⃣\r\nماهي كيفية التقدم \r\nبطلب تعويض عن الأضرار التي حدثت للسيارة بسبب تعمد الحادث من صاحب السيارة ، هل أتقدم بالمطالبة بالتعويض عن الأضرار من خلال المرور أو من خلال المحكمة وماهي الإجراءات القانونية في ذلك ؟\r\n\r\n5️⃣\r\nهل أتقدم بالشكوى في حق المحقق لانه لم ينصفني وعلى الرغم انه شاهد سيارتي متضرره وفيه شاهد على الحادث عامل في نفس المستودع ، ماذا علي أن أفعل ؟\r\n\r\nاطلب مشورتكم قانونيا وتوجيهي بالخطوات القانونية الصحيحة', 1, NULL, 0, NULL, 'هذه قضية كاملة تحتاج محامي وليس استشارة عابرة', NULL, 2, 32, 1, NULL, NULL, 1, 3, 2, 32, 0, 1, 0, 0, NULL, '2023-07-27 07:33:48', '2023-08-07 17:41:17', NULL),
(29, 1480, 1, 'كيف اقدم دعوى', 1, NULL, 0, NULL, 'تم', NULL, 2, 32, 1, NULL, NULL, 1, 3, 2, 32, 0, 1, 0, 0, NULL, '2023-07-27 08:07:46', '2023-08-07 17:43:33', NULL),
(30, 1481, 1, 'هل يحق للشركة فصل موظف على مادة ٨٠ في بعد ارتكابة تعدي على المدير والزملاء  بعد حصوله على خطاب  فترة الاشعار بعدم الرغبة في تجديد العقد الذي بقي على نهايته ٦٠ يوم ووجود اشعار\r\n  ( طلب ) انتقال لكفيل آخر . ؟؟\r\nحيث لا يقبل معنا قبول الانهاء على مادة ٨٠ في نظام مقيم  \r\nوالسؤال هنا هل يحق لنا من الناحية القانونية والنظامية \r\n\r\nولكم جزيل الشكر', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 3, 2, 976, 0, 1, 0, 0, NULL, '2023-07-27 11:24:15', '2023-08-04 16:37:04', NULL),
(31, 1482, 1, '‏صدر حكم درجة أولى من محكمة الجزائية مدينة الخبر والمستائنف ضدي النايبة العامة وتم رفع اعتراض من النايبة وأنا كذلك تم رفع اعترراض وعند انقاد الجلسة \r\n‏تفاجأت بأن الحكم تأييد من الدرجة الأولى ولم يتم ادراجة محل الأستناف بنفس الدائرة المصدرة للحكم ما هو الإجراء النظامي والقانوني هل التقدم لدى المحكمة العليا او ارفع المذكرة إلى التواصل العدلي بهذا الشآن وشكرآ', 1, NULL, 0, NULL, 'السؤال غير واضح هل تقصد برفعك الاعتراض صدر مرة اخرى من المحكمة الابتدائية او صدر من الاستئناف وترغب الاعتراض عليه', NULL, 2, 32, 1, NULL, NULL, 1, 3, 2, 32, 0, 1, 0, 0, NULL, '2023-07-27 12:15:38', '2023-08-07 17:43:11', NULL),
