(34, 1485, 1, 'مشكله اسريه \r\nلدي زوجه اعاني منها ببعض الامور\r\n١ التزين والمكياج والنظافة الجسديه ما تطلع الا اذا جت تروح اهلها\r\n٢ تنوم عند عيالها كاني عزوبي \r\n٣النظافة بالمنزل سيئه جدا جدا\r\n٤ عدم تنظيم الوقت سهر وطول النهار نوم لا اهتمام بالمسئولية والزوج ضياع', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 1, NULL, NULL, 0, 1, 0, 0, NULL, '2023-07-28 12:42:45', '2023-07-28 12:42:45', NULL),
