(43, 1490, 23, 'انا متزوج وعندي 3. اولاد اكبرهم 17 سنه واصغرهم 5 سنوات  وأرغب في التقاعد والانتقال من الجبيل  الصناعيه  والاقامه  في  مسقط  رأسي  نجران  ولكن زوجتي  ترفض بحجه ان الدراسه في الجبيل افضل . وللعلم زوجتي ربه منزل  وهي تعاني من الاكتئاب  والوسواس القهري.\r\nسؤالي هو كيف اجبر زوجتي على الانتقال إلى نجران ؟\r\nوهل استطيع رفع دعوى نشوز  او الخروج من الفيلا التي تسكن فيها حاليا؟\r\nافيدوني ماذا افعل\r\nوشكرا', 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 3, 2, 976, 0, 1, 0, 0, NULL, '2023-08-07 10:41:03', '2023-08-07 15:06:59', NULL),
(44, 1491, 2, 'لدي دعوى محكوم لصالحي فيها وتم تنفيذ المادة ٤٦ لكن بدون منع سفر لماذا وهل استطيع تنفيذ منع السفر عليه ؟ وهل يوجد طريقة اخرى لإجباره على الدفع لانه عدت سنه الا الان ولا دفع شيء', 1, '3cb2c0631a13da358d10777c2cc0c550.jpeg', 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, 1, 3, 2, 976, 0, 1, 0, 0, NULL, '2023-08-07 12:12:34', '2023-08-07 15:06:18', NULL),
