(173, 1595, 1, 'عملت مقاولات من الباطن مع شركة حلول للاتصالات ( وكان العمل حفر ودفن  وتركيب مواصير  اشارات مرور ساهر )  . وعند طلب صرف مستحقاتنا وقدرها ٥٧٧٥٧.٧٠ ريال أفادونا بأن هناك مخالفات من البلدية سوف يحلونها اولاً معهم . وقيمة المخالفات ١٢٠ الف ريال . الان لي اكثر من سنة أطالب المبلغ ولم يتم السداد . سأرفق العقد وبعض المستندات المؤيدة', 1, 'a1573896a38ceca082dd1002983f4c98.jpeg', 0, NULL, NULL, NULL, NULL, NULL, 0, NULL, NULL, NULL, 1, NULL, NULL, 0, 1, 1, 0, NULL, '2024-01-28 08:40:19', '2024-01-28 08:40:19', NULL),
