(19, 'غير محدد', 'خالد حامد المالكي', 'moonrise.55@hotmail.com', '0556628887', 'تعديل بيانات', 'السلام عليكم\r\nمن خلال بياناتي المدخله بالمنصة اتضح ان هناك خطأ في رقم الجوال ، نامل من فريق الدعم تعديل الرقم الى هذا الرقم 0556628887 مع العلم انني حاولت العديل والتحديث من خلال المنصة ولكن دون جدوى, نامل من فريق الدعم تعديل رقم الجوال للاهمية وكون الرقم المدخل لا يخصني اطلاقاً\r\n\r\nخالد المالكي\r\nمستشار قانوني\r\n0556628887', '2022-01-18 12:14:34', NULL, NULL),
