INSERT INTO `digital_guide_packages` (`id`, `title`, `intro`, `price`, `period`, `rules`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(3, 'باقة مكتب المحامي', '<p>هذه الباقة تضمن حصول المشترك على مكتب إلكتروني إداري متكامل يشمل أبرز المزايا التنافسية في البرامج والتطبيقات المدفوعة ومنها :</p><ul><li>نظام أرشفة متكامل للقضايا والعملاء والخصوم والمستفيدين .</li><li>نظام موارد بشرية مصغر وعملي يشمل أهم جوانب إدارة الموارد البشرية كصيغ العقود والرواتب والحضور والانصراف .</li><li>قاعدة بيانات خاصة بالموظفين ومؤشرات لقياس الأداء .</li><li>ستدخل باقة صفحة المحامي ضمن الباقة الأساسية لباقة مكتب المحامي بشكل تلقائي .</li><li>إمكانية التواصل مع هيئة المستشارين والحصول على الاستشارات المتخصصة .&nbsp;</li><li>رابط صفحة خاصة بالمكتب - عند الطلب - تمكنه من التواصل مع عملائه بشعاره الخاص وإشهار اسمه بشكل مستقل .</li><li>نظام فوترة ودفع إلكتروني متكامل .</li></ul>', 3600, 365, '<ul><li>باقة الاشتراك سنوية بمبلغ وقدره (3600) ريال سعودي .</li><li>لا يؤثر عدم الاشتراك في أي من باقاتنا على ظهور الاسم لمقدم الخدمة في الدليل الرقمي العام أو عبر أيقونة البحث المتعلقة فيه .</li><li>يلزم إفصاح المشترك عن كامل بياناته الشخصية والمهنية قبل قبول اشتراكه في الباقة .</li><li>يخضع المشترك في الباقة لكافة الاشتراطات والأنظمة المتعلقة بالمهنة التي تتطلبها الأنظمة السعودية .</li><li>ينصح بها : للمكاتب والشركات ذات العمل المستديم وعقود الاستشارات المستديمة .</li></ul>', 0, '2022-09-22 09:53:11', '2023-06-12 23:43:14', NULL),
(4, 'باقة صفحة المحامي', '<p>صفحة متكاملة بيوزر مستقل للمحامي والمتدرب والمستشار والمهني مليئة بالمزايا التي تساعده على إشهار نفسه بإبراز ما يلي :</p><ul><li>شعار المحامي أو المكتب أو الشركة .</li><li>الصورة الشخصية .</li><li>السيرة الذاتية والمهنية .</li><li>الخدمات المقدمة .</li><li>أسعار الخدمات .</li><li>وسيلة دفع إلكتروني فورية .</li><li>تخصصات متعددة .</li></ul>', 1000, 365, '<ul><li>باقة الاشتراك سنوية بمبلغ وقدره (1000) ريال سعودي .</li><li>لا يؤثر عدم الاشتراك على ظهور الاسم لمقدم الخدمة في الدليل الرقمي العام أو عبر أيقونة البحث المتعلقة فيه .</li><li>يلزم إفصاح المشترك عن كامل بياناته الشخصية والمهنية قبل قبول اشتراكه في الباقة .</li><li>يخضع المشترك في الباقة لكافة الاشتراطات والأنظمة المتعلقة بالمهنة التي تتطلبها الأنظمة السعودية .</li></ul>', 0, '2023-06-11 12:16:50', '2023-06-12 23:43:19', NULL);
