(1048, NULL, NULL, NULL, NULL, 'الوليد خالد العيسى', 46, '0e227bac2436c406dab3a83fb80ba6cf.png', 'Alwalid.alessa@gmail.com', '$2y$10$ojeQD5gFG5rWankeMjbBw.hDk9cnaS8KFjItXemjTquzorAz5fQxq', 'Male', 3, NULL, '966', '505822661', 'شركة العيسى والملحم ، محامون ومستشارون. هي شركة سعودية مهنية، وهي إحدى المنشآت الرائدة في تقديم الخدمات القانونية المهنية والتمثيل القانوني. يتمتع فريقنا بالكفاءات المناسبة، وهم نخبة من المحامين والمستشارين القانونيين كل ما يتعلق بالأعمال القانونية. ونسعى جاهدين لتقديم كل أنواع الدعم القانوني واللازم لعملائنا بأعلى المقاييس لتُناسِب متطلبات عالم الأعمال والشركات والأفراد وأهدافهم في شتى المجالات. وتقدم الشركة استشارات ونصائح قانونية عملية تلبي احتياجات العملاء بأفضل صورة ممكنة، متخذين ما ورد في قواعد السلوك المهني للمحامين مبدأ لنا.', '1083998045', '421873', 0, NULL, 0, 3, '[\"1\",\"9\"]', NULL, 'الوليد خالد العيسى', 1, NULL, 0, 0, 0, 0, NULL, NULL, 1, NULL, NULL, 0, 0, 0, NULL, NULL, 0, 3, '50.22002935409546', '26.300484608368254', NULL, 217, NULL, '2023-07-17 13:12:05', NULL, '1994-11-08', NULL, 'شركة العيسى والملحم للمحاماة والاستشارات القانونية', '٢٠٥١٢٥٧٩٢٨', NULL, 3, NULL, 1, NULL, 1, 'c035b5b52f272b196ff46540f521ecf5.png', NULL, NULL, NULL, NULL, '0e227bac2436c406dab3a83fb80ba6cf.png', '08', '11', '1994', NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL),
