(1607, 'اماني', 'جبريل', 'رزق الله', 'الصامطي', 'اماني جبريل رزق الله الصامطي', NULL, 'person.png', 'Amani.alsamti.2021@gmail.com', '$2y$10$VjkjS810yEw9OhDbDq2HQ.l6Jkrzz1tFWJuh/PXyEQ2K0yXeVAUui', 'Female', 3, NULL, '966', '545775392', 'مُحامية مُرخصة :\r\nللخدمات القانونية :\r\n- الترافع وتقديم استشارة قانونية.\r\n- كتابة وصياغة صحيفة الدعوى ورفعها.\r\n- كتابة المذكرات ولوائح الاعتراض.\r\n- صياغة العقود ومراجعتها.\r\n- تقديم طلبات التنفيذ ومراجعتها.\r\n- تقديم جميع خدمات ناجز ، معين ، واللجان بأنواعها\r\n- مراجعة جميع الجهات الحكومية في مدينة جدة\r\n\r\nمُوثقة معتمدة: \r\n خدماتنا في اعمال التوثيق*\r\n- الافراغ العقاري\r\n- الوكالات الفردية او الشركات\r\n- فسخ الوكالات \r\n-رهن العقار\r\n- فك العقار \r\n- افراغ عقار برهن \r\n- اقرار بالدين وسداده \r\n- الاقرار المالي\r\n- إصدار الوكالات للموقوفين في سجن ( حدا، الايواء الشميسي ، الحاير ، الملز ) و جميع مراكز التوقيف في جدة.', '1123709600', '45767', 0, NULL, 0, 1, '[\"1\",\"2\",\"9\",\"24\",\"27\"]', NULL, 'اماني جبريل رزق الله الصامطي', 1, NULL, 0, 0, 0, 0, NULL, NULL, 1, NULL, NULL, 0, 0, 0, NULL, NULL, 0, 1, NULL, NULL, NULL, 217, '2022-01-12 06:42:17', '2024-02-19 15:18:45', NULL, '1999-10-30', NULL, NULL, NULL, NULL, 1, NULL, 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, '30', '10', '1999', NULL, 3, 4, NULL, NULL, 1, 7, NULL, NULL),
