INSERT INTO `reservations` (`id`, `name`, `case_type_id`, `email`, `message`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'بدر الروقي', 2, 'bdrr211@outlook.sa', 'مرحباً ، الموقع بحاجة إلى تطوير كامل وتغير الشكل والألوان وما إلى ذلك. هل يمكنني مساعدتك في تحديث وتطوير الموقع مع طرح نموذج مشابه لمواقع محاماة عالمية في الولايات المتحدة الأمريكية. يمكنني تغير هيكل وشكل الموقع لشكل مشابه للمواقع العالمية، إذا كان لديكم رغبة أرجو التواصل عبر الإيميل. دمتم بود', 0, '2023-02-27 03:18:30', '2023-02-27 01:18:30', NULL);
