(3, 502, 3, 'نظام 1', '2024-02-06', '2024-02-06', 'ساري', NULL, 'وصف نظام مكافحة جرائم المعلومات', 'نظام مكافحة جرائم المعلومات', 'احد القوانين الجزائية', '<h3>نظام مكافحة جرائم المعلوماتية</h3><h3>1428 هـ</h3><p>بسم الله الرحمن الرحيم</p><h4>مرسوم ملكي رقم م/17 بتاريخ 8 / 3 / 1428</h4><p>&nbsp;</p><p><strong>بعون الله تعالى&nbsp;</strong><br><strong>&nbsp; &nbsp; &nbsp; &nbsp; نحن عبد الله بن عبد العزيز آل سعود</strong><br><strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; ملك المملكة العربية السعودية</strong><br>بناء على المادة (السبعين) من النظام الأساسي للحكم، الصادر بالأمر الملكي رقم (أ/٩٠) وتاريخ ٢٧ / ٨ / ١٤١٢ هـ.&nbsp;<br>وبناء على المادة (العشرين) من نظام مجلس الوزراء، الصادر بالأمر الملكي رقم (أ/١٣) وتاريخ ٣ / ٣ / ١٤١٤ هـ.&nbsp;<br>وبناء على المادة (الثامنة عشرة) من نظام مجلس الشورى، الصادر بالأمر الملكي رقم (أ/٩١) وتاريخ ٢٧ / ٨ / ١٤١٢ هـ.&nbsp;<br>وبعد الاطلاع على قرار مجلس الشورى رقم (٦٨ /٤٣) وتاريخ ١٦ / ٩ / ١٤٢٧ هـ.&nbsp;<br>وبعد الاطلاع على قرار مجلس الوزراء رقم (٧٩) وتاريخ ٧ / ٣ / ١٤٢٨ هـ.</p><p><strong>رسمنا بما هو آت:</strong></p><p><strong>أولًا: </strong>الموافقة على نظام مكافحة جرائم المعلوماتية، بالصيغة المرافقة.&nbsp;<br><strong>ثانيًا: </strong>على سمو نائب رئيس مجلس الوزراء والوزراء – كل فيما يخصه – تنفيذ مرسومنا هذا.</p><p><strong>عبد الله بن عبد العزيز</strong></p><p>&nbsp;</p><p>بسم الله الرحمن الرحيم</p><h4>قرار مجلس الوزراء رقم 79 بتاريخ 7 / 3 / 1428</h4><p>&nbsp;</p><p><strong>إن مجلس الوزراء</strong><br><strong>بعد الاطلاع</strong> على المعاملة الواردة من ديوان رئاسة مجلس الوزراء برقم ٤٧٦٧٥/ب وتاريخ ٢٤ / ١٠ / ١٤٢٧ هـ، المشتملة على خطاب معالي وزير الاتصالات وتقنية المعلومات رقم ٢٣٠ وتاريخ ٢٢ / ٤ / ١٤٢٦ هـ، في شأن مشروع نظام مكافحة جرائم المعلوماتية.&nbsp;<br><strong>وبعد الاطلاع </strong>على المحضرين رقم (٤١١) وتاريخ ٢٩ / ١١ / ١٤٢٦ هـ، ورقم (٥٠٩) وتاريخ ٢٧ / ١٢ / ١٤٢٧ هـ، المعدين في هيئة الخبراء.&nbsp;<br><strong>وبعد النظر </strong>في قرار مجلس الشورى رقم (٦٨ / ٤٣) وتاريخ ١٦ / ٩ / ١٤٢٧ هـ.&nbsp;<br><strong>وبعد الاطلاع </strong>على توصية اللجنة العامة لمجلس الوزراء رقم (٥٠) وتاريخ ١٧ / ١ / ١٤٢٨ هـ.</p><p><strong>يقرر</strong></p><p>الموافقة على نظام مكافحة جرائم المعلوماتية، بالصيغة المرافقة.&nbsp;<br>وقد أعد مشروع مرسوم ملكي بذلك، صيغته مرافقة لهذا.</p><p><strong>رئيس مجلس الوزراء</strong></p><p>&nbsp;</p><h2>نظام مكافحة جرائم المعلوماتية</h2><h3>المادة الأولى</h3><p><strong>يقصد بالألفاظ والعبارات الآتية - أينما وردت في هذا النظام - المعاني المبينة أمامها ما لم يقتض السياق خلاف ذلك:</strong></p><ol><li><strong>الشخص :</strong> أي شخص ذي صفة طبيعية أو اعتبارية ، عامة أو خاصة .</li><li><strong>النظام المعلوماتي : </strong>مجموعة برامج وأدوات معدة لمعالجة البيانات وإدارتها، وتشمل الحاسبات الآلية .</li><li><strong>الشبكة المعلوماتية : </strong>ارتباط بين أكثر من حاسب آلي أو نظام معلوماتي للحصول على البيانات وتبادلها، مثل الشبكات الخاصة والعامة والشبكة العالمية (الإنترنت) .</li><li><strong>البيانات : </strong>المعلومات، أو الأوامر، أو الرسائل، أو الأصوات، أو الصور التي تعد، أو التي سبق إعدادها، لاستخدامها في الحاسب الآلي ، وكل ما يمكن تخزينه، ومعالجته، ونقله، وإنشاؤه بوساطة الحاسب الآلي ، كالأرقام والحروف والرموز وغيرها.</li><li><strong>برامج الحاسب الآلي :</strong> مجموعة من الأوامر، والبيانات التي تتضمن توجيهات أو تطبيقات حين تشغيلها في الحاسب الآلي ، أو شبكات الحاسب الآلي ، وتقوم بأداء الوظيفة المطلوبة.</li><li><strong>الحاسب الآلي :</strong> أي جهاز إلكتروني ثابت أو منقول سلكي أو لا سلكي يحتوي على نظام معالجة البيانات، أو تخزينها، أو إرسالها، أو استقبالها، أو تصفحها ، يؤدي وظائف محددة بحسب البرامج ، والأوامر المعطاة له.</li><li><strong>الدخول غير المشروع :</strong> دخول شخص بطريقة متعمدة إلى حاسب آلي ، أو موقع إلكتروني أو نظام معلوماتي ، أو شبكة حاسبات آلية غير مصرح لذلك الشخص بالدخول إليها.</li><li><strong>الجريمة المعلوماتية :</strong> أي فعل يرتكب متضمنًا استخدام الحاسب الآلي أو الشبكة المعلوماتية بالمخالفة لأحكام هذا النظام.</li><li><strong>الموقع الإلكتروني :</strong> مكان إتاحة البيانات على الشبكة المعلوماتية من خلال عنوان محدد.</li><li><strong>الالتقاط : </strong>مشاهدة البيانات ، أو الحصول عليها دون مسوغ نظامي صحيح .</li></ol><h3>المادة الثانية</h3><p><strong>يهدف هذا النظام إلى الحد من وقوع جرائم المعلوماتية ، وذلك بتحديد هذه الجرائم والعقوبات المقررة لكل منها ، وبما يؤدي إلى ما يأتي :</strong></p><ol><li>المساعدة على تحقيق الأمن المعلوماتي.</li><li>حفظ الحقوق المترتبة على الاستخدام المشروع للحاسبات الآلية والشبكات المعلوماتية .</li><li>حماية المصلحة العامة ، والأخلاق، والآداب العامة .</li><li>حماية الاقتصاد الوطني.</li></ol><h3>المادة الثالثة</h3><p><strong>يعاقب بالسجن مدة لا تزيد على سنة وبغرامة لا تزيد على خمسمائة ألف ريال، أو بإحدى هاتين العقوبتين ؛ كلُّ شخص يرتكب أيًا من الجرائم المعلوماتية الآتية:</strong></p><ol><li>التنصت على ما هو مرسل عن طريق الشبكة المعلوماتية أو أحد أجهزة الحاسب الآلي - دون مسوغ نظامي صحيح - أو التقاطه أو اعتراضه.</li><li>الدخول غير المشروع لتهديد شخص أو ابتزازه ؛ لحمله على القيام بفعل أو الامتناع عنه، ولو كان القيام بهذا الفعل أو الامتناع عنه مشروعًا .</li><li>الدخول غير المشروع إلى موقع إلكتروني ، أو الدخول إلى موقع الكتروني لتغيير تصاميم هذا الموقع، أو إتلافه، أو تعديله، أو شغل عنوانه.</li><li>المساس بالحياة الخاصة عن طريق إساءة استخدام الهواتف النقالة المزودة بالكاميرا، أو ما في حكمها .</li><li>التشهير بالآخرين ، وإلحاق الضرر بهم ، عبر وسائل تقنيات المعلومات المختلفة .</li></ol><h3>المادة الرابعة</h3><p><strong>يعاقب بالسجن مدة لا تزيد على ثلاث سنوات وبغرامة لا تزيد على مليوني ريال، أو بإحدى هاتين العقوبتين؛ كل شخص يرتكب أيًا من الجرائم المعلوماتية الآتية:</strong></p><ol><li>الاستيلاء لنفسه أو لغيره على مال منقول أو على سند ، أو توقيع هذا السند ، وذلك عن طريق الاحتيال، أو اتخاذ اسم كاذب، أو انتحال صفة غير صحيحة .</li><li>الوصول - دون مسوغ نظامي صحيح - إلى بيانات بنكية ، أو ائتمانية، أو بيانات متعلقة بملكية أوراق مالية للحصول على بيانات ، أو معلومات، أو أموال، أو ما تتيحه من خدمات.</li></ol><h3>المادة الخامسة</h3><p><strong>يعاقب بالسجن مدة لا تزيد على أربع سنوات وبغرامة لا تزيد على ثلاثة ملايين ريال، أو بإحدى هاتين العقوبتين؛ كل شخص يرتكب أيًا من الجرائم المعلوماتية الآتية:</strong></p><ol><li>الدخول غير المشروع لإلغاء بيانات خاصة، أو حذفها، أو تدميرها، أو تسريبها، أو إتلافها أو تغييرها، أو إعادة نشرها.</li><li>إيقاف الشبكة المعلوماتية عن العمل، أو تعطيلها، أو تدمير، أو مسح البرامج، أو البيانات الموجودة، أو المستخدمة فيها، أو حذفها، أو تسريبها، أو إتلافها، أو تعديلها.</li><li>إعاقة الوصول إلى الخدمة، أو تشويشها، أو تعطيلها، بأي وسيلة كانت.</li></ol><h3>المادة السادسة</h3><p><strong>يعاقب بالسجن مدة لا تزيد على خمس سنوات وبغرامة لا تزيد على ثلاثة ملايين ريال، أو بإحدى هاتين العقوبتين كلُّ شخص يرتكب أيًّا من الجرائم المعلوماتية الآتية:</strong></p><ol><li>إنتاج ما من شأنه المساس بالنظام العام ، او القيم الدينية، أو الآداب العامة ، أو حرمة الحياة الخاصة، أو إعداده ، أو إرساله، أو تخزينه عن طريق الشبكة المعلوماتية ، أو أحد أجهزة الحاسب الآلي .</li><li>إنشاء موقع على الشبكة المعلوماتية ، أو أحد أجهزة الحاسب الآلي أو نشره ، للاتجار في الجنس البشري، أو تسهيل التعامل به.</li><li>إنشاء المواد والبيانات المتعلقة بالشبكات الإباحية، أو أنشطة الميسر المخلة بالآداب العامة أو نشرها أو ترويجها.</li><li>إنشاء موقع على الشبكة المعلوماتية ، أو أحد أجهزة الحاسب الآلي أو نشره ، للاتجار بالمخدرات، أو المؤثرات العقلية، أو ترويجها، أو طرق تعاطيها، أو تسهيل التعامل بها.</li></ol><p>&nbsp;</p><p><a href=\"https://laws.boe.gov.sa/BoeLaws/Laws/LawDetails/25df73d6-0f49-4dc5-b010-a9a700f2ec1d/1#\">تعديلات المادة</a></p><h3>المادة السابعة</h3><p><strong>يعاقب بالسجن مدة لا تزيد على عشر سنوات وبغرامة لا تزيد على خمسة ملايين ريال، أو بإحدى هاتين العقوبتين كلُّ شخص يرتكب أيًّا من الجرائم المعلوماتية الآتية :</strong></p><ol><li>إنشاء موقع لمنظمات إرهابية على الشبكة المعلوماتية ، أو أحد أجهزة الحاسب الآلي أو نشره؛ لتسهيل الاتصال بقيادات تلك المنظمات، أو أي من أعضائها أو ترويج أفكارها أو تمويلها، أو نشر كيفية تصنيع الأجهزة الحارقة، أو المتفجرات، أو أي أداة تستخدم في الأعمال الإرهابية .</li><li>الدخول غير المشروع إلى موقع إلكتروني ، أو نظام معلوماتي مباشرة، أو عن طريق الشبكة المعلوماتية ، أو أحد أجهزة الحاسب الآلي للحصول على بيانات تمس الأمن الداخلي أو الخارجي للدولة، أو اقتصادها الوطني .</li></ol><h3>المادة الثامنة</h3><p><strong>لا تقل عقوبة السجن أو الغرامة عن نصف حدها الأعلى إذا اقترنت الجريمة بأي من الحالات الآتية:</strong></p><ol><li>ارتكاب الجاني الجريمة من خلال عصابة منظمة .</li><li>شغل الجاني وظيفة عامة ، واتصال الجريمة بهذه الوظيفة، أو ارتكابه الجريمة مستغلًا سلطاته أو نفوذه.</li><li>التغرير بالقُصَّر ومن في حكمهم، واستغلالهم .</li><li>صدور أحكام محلية أو أجنبية سابقة بالإدانة بحق الجاني في جرائم مماثلة.</li></ol><h3>المادة التاسعة</h3><p>يعاقب كل من حرَّض غيره، أو ساعده، أو اتفق معه على ارتكاب أيٍّ من الجرائم المنصوص عليها في هذا النظام ؛ إذا وقعت الجريمة بناء على هذا التحريض، أو المساعدة، أو الاتفاق، بما لا يتجاوز الحد الأعلى للعقوبة المقررة لها ، ويعاقب بما لا يتجاوز نصف الحد الأعلى للعقوبة المقررة لها إذا لم تقع الجريمة الأصلية.</p><h3>المادة العاشرة</h3><p>يعاقب كل من شرع في القيام بأي من الجرائم المنصوص عليها في هذا النظام بما لا يتجاوز نصف الحد الأعلى للعقوبة المقررة .</p><h3>المادة الحادية عشرة</h3><p>للمحكمة المختصة أن تعفي من هذه العقوبات كل من يبادر من الجناة بإبلاغ السلطة المختصة بالجريمة قبل العلم بها وقبل وقوع الضرر، وإن كان الإبلاغ بعد العلم بالجريمة تعين للإعفاء أن يكون من شأن الإبلاغ ضبط باقي الجناة في حال تعددهم، أو الأدوات المستخدمة في الجريمة.</p><h3>المادة الثانية عشرة</h3><p>لا يخل تطبيق هذا النظام بالأحكام الواردة في الأنظمة ذات العلاقة وخاصة ما يتعلق بحقوق الملكية الفكرية ، والاتفاقيات الدولية ذات الصلة التي تكون المملكة طرفًا فيها.</p><h3>المادة الثالثة عشرة</h3><p>مع عدم الإخلال بحقوق حسني النية ، يجوز الحكم بمصادرة الأجهزة، أو البرامج، أو الوسائل المستخدمة في ارتكاب أي من الجرائم المنصوص عليها في هذا النظام، أو الأموال المحصلة منها . كما يجوز الحكم بإغلاق الموقع الإلكتروني ، أو مكان تقديم الخدمة إغلاقًا نهائيًّا أو مؤقتًا متى كان مصدرًا لارتكاب أي من هذه الجرائم ، وكانت الجريمة قد ارتكبت بعلم مالكه.</p><h3>المادة الرابعة عشرة</h3><p>تتولى هيئة الاتصالات وتقنية المعلومات وفقًا لاختصاصها تقديم الدعم والمساندة الفنية للجهات الأمنية المختصة خلال مراحل ضبط هذه الجرائم والتحقيق فيها وأثناء المحاكمة .</p><h3>المادة الخامسة عشرة</h3><p>تتولى هيئة التحقيق والادعاء العام التحقيق والادعاء في الجرائم الواردة في هذا النظام.</p><h3>المادة السادسة عشرة</h3><p>ينشر هذا النظام في الجريدة الرسمية ويعمل به بعد (مائة وعشرين) يومًا من تاريخ نشره.</p>', '8537cbed914cee32e821ad013d113391.docx', 'cea307fe4741b9f8bac61911c3ff57bd.pdf', '2024-02-06 07:12:57', '2024-02-06 07:12:57', NULL);
